lyrics:
1.According to Thy lovingkindness
Father, Have mercy on my sinful, wretched soul;
Make me to know once more Thy joy and gladness, Blot out my sin,

Alive, alive, alive for evermore;
My Jesus is alive,
Alive for evermore.
(He’s) Alive, alive, alive for evermore;
My Jesus is alive

3.Loving their Lord more than life or themselves;
Loving the people they tell
Colourful,passionate, sanctified honed;
Ready to rescue from hell.

God sent His Son,
They called Him Jesus;
He came to love, heal, and forgive;
He lived and died to buy my pardon,
An empty grave is there
To prove my Saviour lives.

Because He lives I can face tomorrow;
Because He lives all fear is gone;
Because I know He holds the future,
And life is worth the living
Just because He lives.

Because He lives I can face tomorrow;
Because He lives all fear is gone;
Because I know He holds the future,
And life is worth the living
Just because He lives.

And then one day I'II cross the river;
I'II fight life's final war with pain;
And then as death gives way to victory,
I'II see the lights of glory
And I'II know He lives.

Because He lives I can face tomorrow;
Because He lives all fear is gone;
Because I know He holds the future,
And life is worth the living
Just because He lives.

By His Word
I have no fear in me;
By His Word, death cannot swallow me;
By His Word, I have prosperity,
By His Word, sickness can’t dwell in me,
By His Word, I walk in victory;
By His Word, I’ve been set free.

Ev’rybody ought to love Him
Ev’rybody everywhere;
Ev’rybody ought to love Him
He will banish ev’ry care:
He’s the Author of Salvation;
Condemnation He did bear;
Jesus died for every nation;
Ev’rybody everywhere.

Follow, Jesus, I will follow Jesus
Anywhere He leads me I will follow,
Follow Jesus, I will follow Jesus;
Anywhere He leads I’ll go.
Across the river, Down through the valley,
Or if it be on the mountain high;
I’ll go, Lord, anywhere You want me;
Take me, here am I.

Over sin He has conquered,
Hallelujah, He has conquered;
Over death victorious,
Hallelujah, victorious;
Over sickness He has triumphed,
Hallelujah, He has triumphed;
Jesus reigns over all!

He owns the cattle on a thousand hills,
The wealth in ev’ry mine;
He owns the rivers and the rocks and rills,
The sun and stars that shine;
Wonderful riches more than tongue can tell,
He is my Father’s so they’re mine as well;
He owns the cattle on a thousand hills,
I know that He will care for me.

I know a fount where sins are washed away;
I know a place where night is turned to day;
Burdens are lifted, blind eyes made to see;
There’s a wonder working pow’r in the blood of Calvary.

1.If you’ve tried everything
And everything has failed;
Try Jesus (Repeat)

3.When your enemy presses in hard, do not fear;
The battle belongs to the Lord.
Take courage, my friend your redemption is near;
The battle belongs to the Lord.

Lead me to some soul today
O, teach me Lord just what to say;
Friends of mine are lost in sin,
And cannot find their way.
Few there are who seem to care,
And few there are who pray;
Melt my heart and fill my life;
Give me one soul today.

Let there be love shared among us,
Let there be love in our eyes;
May now Your love sweep this nation,
Cause us, O Lord to arise,
Give us a fresh understanding;
Of brotherly love that is real;
Let there be love shared among us,
Let there be love.

Living, He loved me;
Dying He saved me;
Buried He carried my sins far away,
Rising He justified freely forever;
One day He’s coming O glorious day!

Shine, Jesus, shine
Fill this land with the Father’s glory;
Blaze, Spirit, blaze
Set our hearts on fire;
Flow, river flow
Flood the nations with grace and mercy;
Send forth Your word,
Lord, and let there be light.

1.Make me a channel of Your peace,
Where there is hatred let me bring Your love;
where there is injury, Your pardon, Lord;
And where there’s doubt true faith in You.

Oh! Master, grant that I may never seek
So much to be consoled as to console;
To be understood, as to understand;
To be loved, as to love with all my soul.

2.Make me a channel of Your peace,
Where there’s despair in life
let me bring hope;
Where there is darkness, only light;
And where there’s sadness ever joy.

Oh! Master, grant that I may never seek
So much to be consoled as to console;
To be understood, as to understand;
To be loved, as to love with all my soul.

Oh! Master, grant that I may never seek
So much to be consoled as to console;
To be understood, as to understand;
To be loved, as to love with all my soul.

O Lord, you’ve done great things, and I will praise you;
I will extol you and magnify Your Name.
O Lord, You’ve done great things, and I will praise you;
I will extol You and magnify Your Name.
I will sing praises unto You, and remember Your goodness;
My past is forgiven and now I have life.
You crown me with steadfast love and tender mercy,
I’ll do Your will and bless-You, O Lord.

3.Ask, and it shall be given unto you, Seek and you shall find;
Knock and it shall be opened unto you
Hallelu, Hallelujah.

“They that wait upon the
Lord shall renew their strength;
They shall mount up with wings as eagles;
They shall run and not be weary;
They shall walk and not faint.”
Teach me Lord, Teach me Lord, to wait.

1.There is a name I love to hear;
I love to sing its worth;
It sounds like music in my ear,
The sweetest name on earth.

1.There is power in the name of Jesus;
We believe in His name.
We have called on the name of Jesus;
We are saved! We are saved!
At His name the demons flee.
At His name captives are freed;
For there is no other name that is higher, Than Jesus!

We’ll be caught up to meet Him in the air;
We’ll be caught up His blessedness to share;
Very soon He will come, to take His people home,
Caught up to meet Him in the air!

1.It’s the presence of Your Spirit, Lord, we need;
It’s the presence of Your Spirit, Lord, we need;
So help us Lord, to worship You;
It’s the presence of Your Spirit, Lord, we need.
